QualityModel_t *InitFdModel(void)
{
    QualityModel_t *model = malloc(sizeof(QualityModel_t));
    model->noOfBoosters = NUMBER_OF_BOOSTERS;
    model->base              = -2;
    model->scale             = 4;
    for (int i = 0; i < NUMBER_OF_BOOSTERS; i++)
    {
        model->yesTree[i]     = (int *)fdYesTree[i];
        model->noTree[i]      = (int *)fdNoTree[i];
        model->missingTree[i] = (int *)fdMissingTree[i];
        model->fLabel[i]         = (int *)fdFLabel[i];
        model->fValue[i]         = (float *)fdFValue[i];
        model->leafValue[i]      = (float *)fdLeafValue[i];
    }
    return model;
}

